webpage.description:
A categoria mais importante na estrutura produtiva do País precisa defender o setor, ampliar a proteção dos direitos e o investimento em políticas de fomento à pesquisa e desenvolvimento que coloquem o Brasil no rumo do que há de mais moderno em tecnologia e informação.

Vivemos hoje uma conjuntura global, onde sem o profissional e as empresas do setor de TI assistiremos a uma  completa paralisação das atividades. Mas quando olhamos nosso cenário nacional, esse mesmo setor que já representa 7.9%* do PIB, segue sem regulamentação adequada e vê investimentos públicos pífios na capacitação profissional e Pesquisa & Desenvolvimento. O local para fazer essas mudanças acontecerem é no Congresso

Durante diversos anos ao lado dos trabalhadores de TI do estado de SP garantii algumas conquistas importantes como a jornada de 40 horas de trabalho e construi algumas das melhores Convenções Coletivas do Brasil que garantiu 20% de aumento em janeiro deste ano, além da garantia de reposição da inflação até 2023.

Conheça algumas das minhas prioridades para o setor e acesse antonioneto.org/propostas para ver nosso plano legislativo completo

Revisão da reforma trabalhista e criação de um novo Código Brasileiro do Trabalho, adequando a realidade trabalho moderno e digital com a proteção dos direitos;

Uma reforma tributária justa, atualizando a tabela do IR e cortando impostos sobre as empresas e o trabalhador, para priorizar o setor produtivo;

Regulamentação das carreiras de Tecnologia da Informação, trazendo segurança e valorização para o setor que já responde por 9% do PIB brasileiro;

Regulamentação do Home Office, com controle de jornada, auxílio para internet e energia, colocando o direito do trabalhador no centro do trabalho moderno;

Defender a reindustrialização do Brasil pela pesquisa e desenvolvimento de práticas verdes e digitais, em sintonia com o que há de mais moderno no mundo;

Jornada semanal de trabalho de 36 horas + 4 horas para formação;

Defesa das empresas públicas detentoras do “novo petróleo”, os dados dos brasileiros, como Dataprev, Serpro, BB Tecnologia, Prodesp, Prodam, IMA e Coderp;

Modernização do sistema educacional para a formação de um exército de profissionais de tecnologia;
